import React from "react";

const ReadOnlyRows = () => {
    return (
        <>
            {
                contacts.map(item => (
                    <tr key={item.id}>
                        <td>{item.fullName}</td>
                        <td>{item.address}</td>
                        <td>{item.phoneNumber}</td>
                        <td>{item.email}</td>
                    </tr>
                ))
            }
        </>
    );
};

export default ReadOnlyRows;
